Revenue_Revenue_Reve_1.query:
q = load "${App.Datasets.IBDeals_EXB_BUL_WVS.FullyQualifiedName}";
q_A = filter q by 'Deal_Bucket' in ["Accrued", "Backlog", "Closed", "Current FY", "Recurring"] && date('Close_Date_Year', 'Close_Date_Month', 'Close_Date_Day') in ["1 fiscal_year ago".."1 fiscal_year ago"];
q_B = filter q by 'Deal_Bucket' in ["Accrued", "Recurring"] && date('Close_Date_Year', 'Close_Date_Month', 'Close_Date_Day') in ["1 fiscal_year ago".."1 fiscal_year ago"];
q_C = filter q by 'Deal_Bucket' in ["Pipeline", "Plan Only"] && date('Close_Date_Year', 'Close_Date_Month', 'Close_Date_Day') in ["1 fiscal_year ago".."1 fiscal_year ago"];
q_D = filter q by 'Deal_Bucket' in ["Backlog", "Closed", "Recurring"] && date('Close_Date_Year', 'Close_Date_Month', 'Close_Date_Day') in ["1 fiscal_year ago".."1 fiscal_year ago"];
result = group q_A by all full, q_B by all full, q_C by all full, q_D by all;
result = foreach result generate sum(q_A.'Revenue')/10 as 'Revenue', sum(q_B.'Revenue')/10 as 'Accrued', sum(q_A.'Revenue')/10 - sum(q_B.'Revenue')/10 as 'Pipeline', sum(q_D.'Revenue')/10 as 'Backlog';
result = limit result 2000;

Revenue_Revenue_Reve_5.query:
q = load "${App.Datasets.IBDeals_EXB_BUL_WVS.FullyQualifiedName}";
q_A = filter q by 'Deal_Bucket' in ["Accrued", "Backlog"] && date('Close_Date_Year', 'Close_Date_Month', 'Close_Date_Day') in ["1 fiscal_year ago".."1 fiscal_year ago"];
q_B = filter q by 'Deal_Bucket' == "Accrued" && date('Close_Date_Year', 'Close_Date_Month', 'Close_Date_Day') in ["1 fiscal_year ago".."1 fiscal_year ago"];
q_C = filter q by 'Deal_Bucket' == "Pipeline" && date('Close_Date_Year', 'Close_Date_Month', 'Close_Date_Day') in ["1 fiscal_year ago".."1 fiscal_year ago"];
q_D = filter q by 'Deal_Bucket' == "Backlog" && date('Close_Date_Year', 'Close_Date_Month', 'Close_Date_Day') in ["1 fiscal_year ago".."1 fiscal_year ago"];
q_E = filter q by 'Deal_Bucket' == "Lost" && date('Close_Date_Year', 'Close_Date_Month', 'Close_Date_Day') in ["1 fiscal_year ago".."1 fiscal_year ago"];
q_F = filter q by date('Close_Date_Year', 'Close_Date_Month', 'Close_Date_Day') in ["1 fiscal_year ago".."1 fiscal_year ago"];
result = group q_A by all full, q_B by all full, q_C by all full, q_D by all full, q_E by all full, q_F by all;
result = foreach result generate sum(q_A.'Revenue')/100 as 'Revenue', sum(q_B.'Revenue')/100 as 'Accrued', sum(q_C.'Revenue')/100 as 'Pipeline', sum(q_D.'Revenue')/100 as 'Backlog', sum(q_E.'Revenue')/100 as 'Lost', sum(q_F.'Fees')/100 as 'Fees';
result = limit result 2000;

Close_Date_Year_Prod_1.query:
q = load "${App.Datasets.IBDeals_EXB_BUL_WVS.FullyQualifiedName}";
q = filter q by ('Deal_Stage' != "Closed-Lost" || 'Deal_Stage' is null);
q = group q by ('Close_Date_Year', 'Deal_Bucket');
q = foreach q generate 'Close_Date_Year' as 'Close_Date_Year', 'Deal_Bucket' as 'Deal_Bucket', sum('Revenue')/100 as 'sum_Revenue';
q = order q by ('Close_Date_Year' asc, 'Deal_Bucket' asc);
q = limit q 2000;

Product_Deal_Type_1.query:
q = load "${App.Datasets.IBDeals_EXB_BUL_WVS.FullyQualifiedName}";
q = filter q by date('Close_Date_Year', 'Close_Date_Month', 'Close_Date_Day') in ["1 fiscal_year ago".."1 fiscal_year ago"];
q = group q by 'Deal_Type';
q = foreach q generate 'Deal_Type' as 'Deal_Type', sum('Revenue')/100 as 'sum_Revenue';
q = order q by 'Deal_Type' asc;
q = limit q 2000;

